import React from 'react';

class EventLoc extends React.Component {

    constructor(props) {
        super(props)
    }


    render = () => {
        if (this.props.coordinates) {
            const latitude = this.props.coordinates[0]
            const longitude = this.props.coordinates[1]
            const new_src = "https://maps.googleapis.com/maps/api/staticmap?center=" + latitude + "," + longitude +
                "&zoom=50&size=600x400&maptype=terrain&markers=color:red%7Clabel:C%7C+" + latitude + "," + longitude +
                "&key=AIzaSyB-oQnkpiDtJiV7YX05PQxmHJviThfoa3o"
            // TO DO #5: Display the actual details of the selected station
            //           instead of the placeholder text you see below. - DONE
            // <img src={asteroid_pic} width={100} height={125} alt="Ast_pic" />
            return (
                <img src={new_src} alt="event_loc" />
            )
        } else {
            return (
                <div className="col-sm-4">
                </div >
            )
        }
    }
}


export default EventLoc;
